import classes from './AvailableMeals.module.css';
import Card from '../UI/Card';

const DummyMeals = [
{
    id: 'm1',
    name: 'chicken curry',
    desc: 'chicken with tomato curry',
    price: 20.99
},
{
    id: 'm2',
    name: 'shrimp curry',
    desc: 'shrinp with coconut and onion tomato curry',
    price: 20.99
},
{
    id: 'm3',
    name: 'veg biryani',
    desc: 'spices rice with veggies',
    price: 20.99
},
{
    id: 'm4',
    name: 'lamb curry',
    desc: 'lamb with tomato curry',
    price: 20.99
}
];
 const AvailableMeals = () => {
   const mealslist = DummyMeals.map((meal) => <li>{meal.name}</li>);

   return (
       <section className={classes.mealslist}> 
            <Card>{mealslist}</Card>
       </section>
   );
 }

  export default AvailableMeals;
